latestIgtvVideos.caption:
It’s FRIYAY! With that, say yay for my first video in which I share my Night Time Skincare Routine with y’all. It’s simple, doable and super easy with more than affordable products. Don’t miss my signing off line ♥️

✅All the products are cruelty free and plant based. 

✅Sound on for the lovely indie track in the background. Excuse the clumsiness of my hands. Have left most parts unedited since I love being raw and real🌸

✅I have oily and acne prone skin and barring the Eclat eye serum, I’ve been using all the other products for well over 45 days. 

✅Have the same skin type as mine? Shoot your questions below!♥️

